import React from "react";
import { useHistory } from "react-router-dom";

const CreateDeck = () => {
    const history = useHistory();

    return (
        <button 
            className="btn btn-default" 
            type="button"
            onClick={() => history.push("./decks/new")}
        >
            Create Deck!!
        </button>
    )
}

export default CreateDeck;
